                     en: "Send messages to contacts in an excel spreadsheet. Use the template spreadsheet (<a href='https://whatsup.plus/models/excel-whatsup.xlsx'>Download here<a>). You must feed the 'NAME' column with the names and the 'NUMBER' column with the numbers (Remember to include the international country code). You can use column values in your message, type @ in the text message field and select the column you want to insert. The maximum limit is 20,000 contacts per sheet. All numbers are verified and the message is only sent to contacts who have Whatsapp.",
                     fr: "Envoyez des messages aux contacts dans une feuille de calcul Excel. Utilisez le mod\u00e8le de feuille de calcul (<a href='https://whatsup.plus/models/excel-whatsup.xlsx'>T\u00e9l\u00e9charger ici<a>). Vous devez alimenter la colonne 'NOM' avec les noms et la colonne 'NUMERO' avec les chiffres (N'oubliez pas d'inclure le code international du pays). Vous pouvez utiliser des valeurs de colonne dans votre message, tapez @ dans le champ du message texte et s\u00e9lectionnez la colonne que vous souhaitez ins\u00e9rer. La limite maximale est de 20 000 contacts par feuille. Tous les num\u00e9ros sont v\u00e9rifi\u00e9s et le message n'est envoy\u00e9 qu'aux contacts qui ont Whatsapp.",
                     es: "Env\u00eda mensajes a contactos en una hoja de c\u00e1lculo de Excel. Utilice la plantilla de hoja de c\u00e1lculo (<a href='https://whatsup.plus/models/excel-whatsup.xlsx'>Desc\u00e1rguela aqu\u00ed<a>). Debe alimentar la columna 'NOMBRE' con los nombres y la columna 'N\u00daMERO' con los n\u00fameros (Recuerde incluir el c\u00f3digo internacional del pa\u00eds). Puede usar valores de columna en su mensaje, escriba @ en el campo de mensaje de texto y seleccione la columna que desea insertar. El l\u00edmite m\u00e1ximo es de 20.000 contactos por hoja. Todos los n\u00fameros est\u00e1n verificados y el mensaje solo se env\u00eda a los contactos que tienen Whatsapp.",
                     pt: "Envie mensagens para contatos em uma planilha de excel. Use a planilha modelo (<a href='https://whatsup.plus/models/excel-whatsup.xlsx'>Download aqui<a>). Voc\u00ea deve alimentar a coluna 'NAME' com os nomes e a coluna 'NUMBER' com os n\u00fameros (Lembre de incluir o c\u00f3digo internacional do pa\u00eds). Voc\u00ea pode usar valores de colunas na sua mensagem, digite @ no campo da mensagem de texto e selecione a coluna que deseja inserir. O limite m\u00e1ximo \u00e9 de 20 mil contatos por planilha. Todos os n\u00fameros s\u00e3o verificados e a mensagem s\u00f3 \u00e9 envianda para os contatos que tem Whatsapp."
