                     es: "Al usar esta opci\u00f3n, todos los participantes ser\u00e1n mencionados (etiquetados) en su mensaje. Esto asegura que todos ser\u00e1n notificados, incluso aquellos con el grupo en modo silencioso. Solo puede usar esta opci\u00f3n cuando env\u00ede un mensaje de texto, imagen o video. Las menciones se agregar\u00e1n de forma silenciosa, solo se notificar\u00e1 al participante y no habr\u00e1 etiquetas en el mensaje.",
                     pt: "Usando essa op\u00e7\u00e3o todos os participantes ser\u00e3o mencionados (Marcados) na sua mensagem. Isso garante que todos ser\u00e3o realmente notificados, mesmo aqueles que est\u00e3o com o grupo no modo silencioso. S\u00f3 \u00e9 poss\u00edvel usar essa op\u00e7\u00e3o quando se envia uma mensagem de texto, imagem ou video. As men\u00e7\u00f5es ser\u00e3o adicionadas de forma silenciosa, apenas o participante ser\u00e1 notificado e n\u00e3o haver\u00e1 marca\u00e7\u00f5es na mensagem."
